package packaged;

import java.util.HashSet;
import java.util.Set;

public class GetShifty {
	
	
	//so its at 1 you move over 3 places and get that number?
	private static String shiftMe = "";

	
	
	public static void main(String []args) {
		
		int i = 0;
		while(i < shiftMe.length()) {
		
			String iHateThis = shiftMe.substring(i, i + 14);
			
			Set<String> superCheesy = new HashSet<>();
			for(char c : iHateThis.toCharArray()) {
				superCheesy.add(c + "");
			}
			
			if(superCheesy.size() == 14) {
				System.out.println(i+14);
				break;
			}

			++i;
		}
	}
}
